import React from 'react';
import Header from './components/header/Header';
import Title from './components/title/Title';

import './data/nav'

function App() {
    return (
      <div>
      <Header name={53535} />
      <main>
          <div className="wrapper">
              <Title title={'Главная страница'}/>
          </div>
      </main>
      </div>
    );
}

export default App;
